import React from 'react';
import { Card, Image } from 'semantic-ui-react';

const Game = (props) => {
    const { game } = props
    return (
        <Card>
            <img src={game.img} />
            <Card.Content>

                <Grid.Column>
                    <h1>Game Name: {game.title}</h1> 
                    <p>Game Price:{game.price}</p>
                    <p>Game Description:{game.details}</p>

                </Grid.Column>
            </Card.Content>
        </Card>
    )
}



export default Game;
